class Solution(object):
    def maxStarSum(self, vals, edges, k):
        """
        :type vals: List[int]
        :type edges: List[List[int]]
        :type k: int
        :rtype: int
        """
        n = len(vals)
        g =[[] for _ in range(n)]
        for a,b in edges:
            g[a].append(b)
            g[b].append(a)
        mx = max(vals)
        for i in range(n):
            ls = []
            for b in g[i]:
                ls.append(vals[b])
            ls.sort(reverse= True)
            t = vals[i]
            cand = ls[:k]
            for i in range(len(cand)):
                t += ls[i]
                mx = max(mx,t)
        return mx
            



